import React, { Component } from 'react'
import socketIOClient from "socket.io-client"; 
const ENDPOINT = "localhost:5000";
const config = require('./../config.json');


export default class App extends Component {

  constructor (props){
    super(props)
    this.state = {
      isLoaded: false,
      items: {}
    }
  }

  componentDidMount(){
    const socket = socketIOClient(config.app.host+":"+config.host.port);
    socket.on("newData", data => {
      this.setState({
        isLoaded: true,
        items: data
      });
      console.log(data)
    });
  }


  render() {
    const {isLoaded, items } = this.state;

    if (!isLoaded) {
      return <div>Loading...</div>;
    } else {
      return (
        //<NavBar />
        //<Activity />
        //<Graphs /> 
        //<Table /> 
        <div>Hello!!!It is {items._mmsImageKey_Value} </div>  
      );
    }
  }
}
